import React from "react";
import "./App.css";
import HeaderItem from "./HeaderItem";

function App() {
  return (
    <div className="App">
      <div id="header">
        <HeaderItem
          headerH1Item="Cory Cox Test Website"
          headerH2Item="Test site for Cory Cox"
          headerH3Item="Current Projects:"
        />
      </div>

      <div id="button-group">
        <button type="button" className="btn btn-secondary">
          <a href="/js-counter/">JS Counter</a>
        </button>
        <button type="button" className="btn btn-secondary">
          <a href="/random-number-draw/">Random Number</a>
        </button>
      </div>
    </div>
  );
}

export default App;
